import matplotlib.pyplot as plt
import datetime
import numpy as np

def plot_cdf_boolean_with_dates(boolean_list, fname):
    """
    Plots the cumulative distribution function (CDF) for a boolean list with dates on the x-axis.

    Parameters:
        boolean_list (list of bool): A list of boolean values (several thousand elements).
    """
    # Compute cumulative sum
    cumulative_sum = np.cumsum(boolean_list)

    # Generate dates starting from 1 Jan 1990
    start_date = datetime.date(1960, 1, 1)
    dates = [start_date + datetime.timedelta(days=i) for i in range(len(boolean_list))]

    # Plot the CDF
    plt.figure(figsize=(12, 6))
    plt.plot(dates, cumulative_sum, label="Cumulative Count", color="blue")

    # Format x-axis with appropriate ticks
    plt.gca().xaxis.set_major_locator(plt.MaxNLocator(10))  # Set maximum of 10 ticks
    plt.gcf().autofmt_xdate()  # Auto-format the dates for better readability

    # Add labels and title
    plt.xlabel("Date")
    plt.ylabel("Cumulative Count")
    plt.title(f"Cumulative Count Of Percentile Exceedances 1990-2020, {fname}")
    plt.legend()
    plt.grid(True, linestyle='--', alpha=0.7)

    # Display the plot
    # plt.show()
    plt.savefig(fname)
    
